import Navbar from "../components/Navbar";
import Cta from "../components/CTA";
import Footer from "../components/Footer";

export default function Develop() {
  return (
    <div>
      <Navbar />
      <div className="max-w-7xl mx-auto mt-16 mb-32 px-4 sm:px-6 lg:px-8">
        <div className=" mx-auto text-left">
          <h2 className="text-4xl font-extrabold text-gray-900">Software Development</h2>
          <p className="my-4 text-lg text-gray-500">
            At Wolfware Digital we specialise in the development of multiple forms of digital application and web development.  Below are just some of the platforms we have experience developing with.
          </p>
        </div>
        <div id="medium-widget"></div>
      </div>

      <Cta />
      <Footer />
    </div>
  );
}
